import React from 'react';
import {
    Image,
    StyleSheet,
    View,
    ScrollView,
    SafeAreaView,
    Text,
    TouchableOpacity,
  } from "react-native";

function MainScreen(props) {
    return (
        <View style={styles.background1}></View>
    );
}

const styles = StyleSheet.create({
    background1:{
        width:'100%',
        height:300,
        backgroundColor:'#569bdc',
    }
})

export default MainScreen;
